{'time': 1476315962928, 'text': 'We are of course very sad when someone is unhappy with their arrangements, we wish that we could make everyone happy all the time. While yes, we do have photos on our website provided by Teleflora, flowers are not a manufactured product and it is unreasonable to expect that an arrangement is going to look ‚Äúexactly‚Äù like a photo; we only ever promise that we will get it as close as we can with what is available.  And yes, a $45 arrangement with a $15 delivery fee, plus tax does = $65. Flowers are priced by the stem and because the daisies came in very tight this week, the yellow solidago filler was added to help fill out the arrangement a little more‚Ä¶ that was my judgment call, I just thought it looked better, so I apologize.

When she called to say she was unhappy, we immediately offered her a replacement but she refused, as she felt we were being unfair because we originally charged for delivery. As for her mother; when she came in, my staff dropped everything straight way to help her and freshened up the arrangement as she requested, she seemed please when she left. As with any order, there is a 72 Hour product guarantee for replacement and if brought into the shop we are happy to freshen it up for up to a week.

We invite readers to judge for themselves; check out our photo gallery of custom arrangements we have done for other clients, along with testimonials that have been e-mailed to us at www.bumblebeeblooms.com.'}

