{'time': 1467808628659, 'text': "Miscommunication indeed.  Unfortunately we really missed each other when in our discussions about the removal and replacement I thought I had made it quite clear that we were only grinding the stump below grade and that there would be large buttress roots or some of the core still in that location.  I had recommended moving the planting site away several feet so there would only be smaller roots for the installers to deal with, we ALWAYS recommend planting in a new hole and not in the same hole.  We never 'dig out the roots' as that would triple the cost, we stump grind to remove the unsightly stump and yet be cost effective but warn people that there will be root mass or stump underground, thus we always recommend moving to another planting site and letting the decomposition of the roots take place naturally and feed the new tree.

I regret that Dwight felt that we were somehow to blame for his installers not knowing to reset the location or misunderstanding my warnings, but I tried to save him money and the agreement clearly states 'stump grinding'.  Had we been commissioned to dig it out it would have been much more expensive so perhaps he saved money on that end using the installers to do that digging work (to explain: my guys are paid climbers wages and the insurance on them is 10x what it is for landscapers, so, for them to be paid to dig around in the dirt my cost would be double, therefore it probably cost a lot less to have the professional diggers do the root removal)

Again, sorry for the miscommunication, let me know if I can be of any further service."}

